package javaEclips;

import java.util.Scanner;

public class Reverse_table {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num;
		Scanner sc=new Scanner(System.in);
		num=sc.nextInt();
		int i=10;
		while(i<=1)
		{
			System.out.println(num);
			i--;
		}
	}

}
